import React from 'react';

function CreateUser({ username, email, onChange, onCreate }) {
    return(
        <div>
            <input 
                name="username" 
                placeholder="계정명" 
                onChange={onChange}
                value={username}
            />
            <input 
                name="email" 
                placeholder="이메일" 
                onChange={onChange}
                value={email}
            />
            <button onClick={onCreate}>등록</button>
        </div>
    )
}

// React.memo -> 컴포넌트 리렌더링 방지
export default React.memo(CreateUser);
